import React from 'react';

const Song = props => {
    return (
        <div className="card" width="200">
            <button type="button">
                <img src={props.image} width="100" height="100" />
            </button>
            <div className="title">
                {props.title}
            </div>
        </div>
    );
}

export default Song;
